
CREATE TABLE IF NOT EXISTS `Commandes`(
	`ID` INTEGER AUTO_INCREMENT,
	`DateCmd` DATETIME,
	`DateEnvoi` DATETIME,
	`DatePromise` DATETIME,
	`Ville` TEXT,
	`Pays` TEXT,
	`DépôtDépart` TEXT,
	`Transporteur` TEXT,
	`Montant` NUMERIC(10,2),
	`Frais de port` NUMERIC(10,2),
	`Responsable` TEXT,
	`Alerte` NUMERIC,
	`ordre` NUMERIC,
	PRIMARY KEY(`ID` )
);


;